children.text:
	* {
		margin: 0;
		padding: 0;
		orphans: 1;
		widows: 1;
		page-break-inside: inherit;
	}
	html, body {
		height:100%;
		line-height: 1;
	}
	div.spacers {
		height: 50%;
	}
	div#takeTwo {page-break-before: always}
	div.backUp {margin-top: -4em;}
	div#break1 {
		width: 0;
	}
	div#break2 {
		page-break-inside: avoid;
		page-break-inside: auto;
		width: 0;
	}
	p {
        margin: 1em;
}
